import React, { Component } from "react";
import {
    Card, CardImg, CardText, CardBody,
    CardTitle, CardSubtitle, Button, ListGroup, ListGroupItem
  } from 'reactstrap';
  import Switch from "react-switch";
class DBA extends Component {
  constructor() {
    super();
    this.state = {
      name: "React",
      checked: false,
      balance: 0
    };
    this.handleChange = this.handleChange.bind(this);
  }
  handleChange(checked) {
    alert('button');
    this.setState({ checked });
  }
  ToggleButton(){
    this.setState((currentState) => ({
      activated: !currentState.activated, 
    }));
  }
  render() {
    return (
      <div classNAme = "container">
        <h1 className="h1">My DBA Account</h1>
        <Card style={{ width: '18rem' }} className = ".card">
          <CardTitle className = 'title'> Business One </CardTitle>
          <hr></hr>
          <CardBody className="summary">
            <p>InterestRate: 0.01%</p>
            Balance: ${this.state.balance}
            <hr></hr>
          <button>Transfer</button>
          </CardBody>
          <p>
            <hr></hr>
          </p>
          <label>
                  <Switch onChange={this.handleChange} checked={this.state.checked} />
            </label>
        </Card>
        <Card style={{ width: '18rem' }} className = ".card">
          <CardTitle className = 'title'> Business Two </CardTitle>
          <hr></hr>
          <CardBody className="summary">
            <p>InterestRate: 0.01%</p>
            Balance: ${this.state.balance}
            <hr></hr>
          <button>Transfer</button>
          </CardBody>
          <p>
            <hr></hr>
          </p>
          <label>
                  <Switch onChange={this.handleChange} checked={this.state.checked} />
            </label>
        </Card>
        <Card style={{ width: '18rem' }} className = ".card">
          <CardTitle className = 'title'> Business Three </CardTitle>
          <hr></hr>
          <CardBody className="summary">
            <p>InterestRate: 0.01%</p>
            Balance: ${this.state.balance}
            <hr></hr>
          <button>Transfer</button>
          </CardBody>
          <p>
            <hr></hr>
          </p>
          <label>
                  <Switch onChange={this.handleChange} checked={this.state.checked} />
            </label>
        </Card>
      </div>
    );
  }
}
export default DBA;
